import { Injectable } from  '@angular/core';
import { HttpClient } from  '@angular/common/http';

@Injectable( {
    providedIn : "root"
})
export class UserService{
    url:string = "http://localhost:8080/register";
    constructor(private browser : HttpClient){}

    register(phone:string, name:string, password:string){
        return this.browser.post<any>(this.url, {uName : name, uPhone : Number(phone), uPassword : password});
    }
}
